#[include accelerometer.cfg]
[include eddy.cfg]
[include macros.cfg]
[include mainsail.cfg]
[include pinout.cfg]
[include shaketune.cfg]
[include steppers.cfg]
[include temperature_limits.cfg]

[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[printer]
kinematics: delta
minimum_z_position: -15
max_velocity: 300
max_z_velocity: 150
max_accel: 5000
square_corner_velocity: 5.0
print_radius: 180

[delta_calibrate]
radius: 160
speed: 50
horizontal_move_z: 5

[stepper_a]
homing_speed: 40

[extruder]
filament_diameter: 1.75
max_extrude_cross_section: 5
max_extrude_only_accel: 1500
max_extrude_only_distance: 1000
max_extrude_only_velocity: 75
nozzle_diameter: 0.40
sensor_type: Generic 3950

[thermistor Trianglelab-NTC100K-B3950]
temperature1: 25
resistance1: 103180
temperature2: 150
resistance2: 1366.2
temperature3: 250
resistance3: 168.6

[gcode_arcs]
resolution: 0.1

[idle_timeout]
timeout: 28800

[display_status]
[endstop_phase]
[exclude_object]
[pause_resume]
[respond]

